// No episode associated.....
function PickEpisode() {
	// Get the list of episodes
	Vitro.Workflow.GetEpisodes(pID, function(epis) {
	
		var bestIndex;
		var today = new Date();
		var admission;
		var least;
		var test;
		var i;
		
		// No episodes - close this mother....
		if(epis.length == 0)
		{
			myApp.Action(Vitro.ACTIONS.Close);
			return;
		}
		
		// test if they are all cancelled or not
		for(i = 0; i < epis.length; i++)
		{
			// At least one episode is not cancelled
			if(epis[i].EpisodeType != CANCELLED_EPISODE)
				break;
				
			// If we get here and this is the last episode - then this and all prior episodes are cancelled - close the app
			if(i == epis.length - 1)
			{
				myApp.Action(Vitro.ACTIONS.Close);
				return;
			}
		}


		// Find the first episode with no discharge date and with an inpatient type.
		for(i = 0; i < epis.length; i++)
		{
			// No discharge date?
			if(epis[i].DischargeDate == "" || epis[i].DischargeDate == null)
			{
				// Inpatient episode type - done - there should be only one
				if(epis[i].EpisodeType == INPATIENT_EPISODE || epis[i].EpisodeType == INPATIENT_EPISODE_STATISTICAL)
				{
					// Force episode
					myApp.Episode(epis[i].Id);
					eID = epis[i].Id;

					// Got the episode, boot the App....
					BootStrap();
					
					return;
				}
			}
		}
		
		// Else select the episode with no discahrge date and oldest admission date
		admission = epis[0].AdmissionDate.substring(0, 10).split("/");
		admission[0] = parseInt(admission[0], 10);
		admission[1] = parseInt(admission[1], 10) - 1;
		admission[2] = parseInt(admission[2], 10);
		
		least = new Date(admission[2], admission[1], admission[0], 0, 0, 0, 0);
		
		// For each episode
		for(i = 0; i < epis.length; i++)
		{
			admission = epis[i].AdmissionDate.substring(0, 10).split("/");
			admission[0] = parseInt(admission[0], 10);
			admission[1] = parseInt(admission[1], 10) - 1;
			admission[2] = parseInt(admission[2], 10);

			// No discharge date and not cancelled or inpatient episode type
			if((epis[i].DischargeDate == "" || epis[i].DischargeDate == null) && 
				(epis[i].EpisodeType != INPATIENT_EPISODE && epis[i].EpisodeType != INPATIENT_EPISODE_STATISTICAL && epis[i].EpisodeType != CANCELLED_EPISODE))
			{
				test = new Date(admission[2], admission[1], admission[0], 0, 0, 0, 0);

				// Compare a test date to find the one oldest one.
				if(typeof(bestIndex) === "undefined" || test.getTime() <= least.getTime())
				{
					least = test;
					bestIndex = i;
				}
			}
		}

		// Did not find an episode with no discharge date
		if(typeof(bestIndex) === "undefined")
		{
			// So find the episode with the most recent past admission
			admission = epis[0].AdmissionDate.substring(0, 10).split("/");
			admission[0] = parseInt(admission[0], 10);
			admission[1] = parseInt(admission[1], 10) - 1;
			admission[2] = parseInt(admission[2], 10);
			
			least = new Date(admission[2], admission[1], admission[0], 0, 0, 0, 0);
			
			// For each episode
			for(i = 0; i < epis.length; i++)
			{
				// Skip cancelled episodes
				if(epis[i].EpisodeType == CANCELLED_EPISODE)
					continue;
					
				admission = epis[i].AdmissionDate.substring(0, 10).split("/");
				admission[0] = parseInt(admission[0], 10);
				admission[1] = parseInt(admission[1], 10) - 1;
				admission[2] = parseInt(admission[2], 10);

				test = new Date(admission[2], admission[1], admission[0], 0, 0, 0, 0);

				// Compare a test date to find the one closest to today, but in the past.
				if(test.getTime() < today.getTime() && test.getTime() > least.getTime())
				{
					least = test;
					bestIndex = i;
				}
			}
		}
		
		// Did not find an episode closest to today but in the past
		if(typeof(bestIndex) === "undefined")
		{
			// So find the episode with the most recent future admission  - or default to the first one
			admission = epis[0].AdmissionDate.substring(0, 10).split("/");
			admission[0] = parseInt(admission[0], 10);
			admission[1] = parseInt(admission[1], 10) - 1;
			admission[2] = parseInt(admission[2], 10);
			
			least = new Date(admission[2], admission[1], admission[0], 0, 0, 0, 0);
			bestIndex = 0;
			
			// For each episode
			for(i = 0; i < epis.length; i++)
			{
				// Skip cancelled episodes
				if(epis[i].EpisodeType == CANCELLED_EPISODE)
					continue;

				admission = epis[i].AdmissionDate.substring(0, 10).split("/");
				admission[0] = parseInt(admission[0], 10);
				admission[1] = parseInt(admission[1], 10) - 1;
				admission[2] = parseInt(admission[2], 10);

				test = new Date(admission[2], admission[1], admission[0], 0, 0, 0, 0);

				// Compare a test date to find the one closest to today, but in the future.
				if(test.getTime() > today.getTime() && test.getTime() < least.getTime())
				{
					least = test;
					bestIndex = i;
				}
			}
		}		
		// Force episode
		myApp.Episode(epis[bestIndex].Id);
		eID = epis[bestIndex].Id;

		// Got the episode, boot the App....
		BootStrap();
	});
}

function BootStrap() {
	// Reset key variables
	activities = null;
	appsSelected = {};
	appsSelectedCount = 0;
		
	// Get all activities for the patient and episode
	Vitro.Workflow.GetActivities(pID, eID, undefined, "", function(acts) {
		// Initialise
		activities = [];

		// Filter out the ones that already exist for that episode
		for(var i = 0; i < acts.length; i++)
		{
			// Push the Id to the the array
		    if(acts[i].Status == Vitro.STATUS.Submitted || acts[i].Status == Vitro.STATUS.Draft || acts[i].Status == Vitro.STATUS.Sealed) {
				activities.push(acts[i]);
			}
		}

		// We are ready - are we?
		Ready();
	});


}

// Get the apps - in parallel to other starup tasks
Vitro.Workflow.GetApps(function(resp) {
	var appCopy;
	
	for(var i = 0; i < resp.length; i++)
	{
		// Filter unassigned ones
		if(resp[i].Category == UNASSIGNED)
			continue;
		
		// Filter unnecessary Apps
		if(resp[i].Patientless || resp[i].Activityless || resp[i].IsHidden)
			continue;
			
		// Copy Apps array to a custom object
		appCopy = {};
		appCopy.Id = resp[i].Id;
		appCopy.Name = resp[i].Name;
		appCopy.Category = resp[i].Category;
		appCopy.Description = resp[i].Description;
		appCopy.Active = false;
		appCopy.Multi = (resp[i].Name in activeApps) ? true : false;
		appCopy.Used = false;
		appCopy.Index = i;

		apps.push(appCopy);

		// Set the dictionary of id to object
		mapAppId[appCopy.Id] = appCopy;
		
		// Number of apps in each category
		if(resp[i].Category in Categories) {			
			Categories[resp[i].Category].Count++;
			Categories[resp[i].Category].Apps.push(appCopy);
		}
		// New category
		else
		{
			Categories[resp[i].Category] = {};
			Categories[resp[i].Category].Displayed = false;
			Categories[resp[i].Category].Drawn = false;
			Categories[resp[i].Category].Count = 1;
			Categories[resp[i].Category].Apps = [];
			Categories[resp[i].Category].Apps.push(appCopy);
			categoryCount++;
		}		
	}
	
	// Does exactly that
	MakeCategories();

	// Calculate the zoom
	var zoom = (myApp.Properties.ViewWidth() - 50) / PAGE_WIDTH;
	// For each page
	pages.Iterate(function(pg) {
		if (pg.Title() != LOADING) {
			// set the zoom
			pg.ZoomTo(zoom);
			// Set the page height depending on the number in each category - while keeping a minimum height
			pg.Set(Vitro.PAGE.Height, Math.max(Categories[pg.Title()].Count * CONTROL_HEIGHT + PADDING, myApp.Properties.ViewHeight() / zoom));
			// Get the order from the index of the sorted pagenames array
			var order = (pageNames.indexOf(pg.Title()) + 1);
			// Set the page order too
			pg.Order(order);
		}		
	});
	
	// Draw the General category - time optimising
	if(GENERAL in Categories) { LayoutCategory(GENERAL); }
	
	// Are we there yet?
	Ready();
});

// Set used/active state for all Apps
function ResolveUsage() {
	var i;
	var app;
	// Reset used/active state for all apps
	for(i = 0; i < apps.length; i++) {
		apps[i].Active = false;
		apps[i].Used = false;
	}

	// Loop through the activities for the patient/epsiode
	for(i = 0; i < activities.length; i++) {
		// Filter apps that are not in our dictionary
		app = mapAppId[activities[i].AppId];
		if(typeof app === "undefined")
			continue;

		// Activities that are in play
		if(activities[i].Status == Vitro.STATUS.Submitted || activities[i].Status == Vitro.STATUS.Draft)
			app.Active = true;
		// Activities that are sealed
		else if(activities[i].Status == Vitro.STATUS.Sealed)
			app.Used = true;
	}
}

