// Default Ready handler
function myApp_Ready() {
	ready = true;
//	debugger;
	// Create the loading dynamic label
	var props = {};
	props[Vitro.CONTROL.Position] = "0,0";
	props[Vitro.CONTROL.Border] = "False";
	props[Vitro.LABEL.Content] = "Loading......";
	loading = myApp.Selected.CreateControl(Vitro.TYPE.Label, props);

	// Are we ready yet?
	Ready();
}

// Make the category pages
function MakeCategories()
{
	var pg;
	for(var cat in Categories)
	{
		// Use the first page as General
		if(cat == GENERAL) {
			pg = myApp.Selected;
		}
		else {
			// Otherwise clone the first page
			pg = myApp.PageManager.Clone(myApp.Selected);
			// Add ot our Pages collection
			pages.Add(pg);
		}
		// Set the title and make not deleteable
		pg.Title(cat).Deletable(false).Disable();
		Categories[cat].Page = pg;
		pageNames.push(cat);
	}
	pageNames.sort();
}

// Checks if we have all data and views to begin creating pages and layout
function Ready() {
		// If App_Ready was not called, or the Apps are not loaded or the activities are not loaded - we're not ready
	if(!ready || !apps.length || activities === null)
		return;

	// We can remove the loading.... dynamic control
	if(loading != null)
	{
		myApp.Selected.DestroyControl(loading);
		loading = null;
	}

	// Find out the usage of the apps
	ResolveUsage();

	myApp.Enable(Vitro.ACTIONS.Episode);
	myApp.Enable(SEARCH);
	
	pages.Each.Enable();
		
	// Set "General" as the start page
	if(GENERAL in Categories) {
		Categories[GENERAL].Page.Activate();
		Categories[GENERAL].Displayed = true;
	}
	var keys = [];
	for (var k in Categories) {
		keys.push(k)
	}
	keys.sort();
	Categories[keys[0]].Page.Activate();
	Categories[keys[0]].Displayed = true;
	myApp.Page(SELECTED).Hide();

	// If the episode has a dischage date or it is a cancelled episose
	if(myApp.Activity.Properties.Episode(Vitro.EPISODE.Discharge) != "" ||
		myApp.Activity.Properties.Episode(Vitro.EPISODE.Type) == CANCELLED_EPISODE)
	{
		myApp.Disable(SEARCH);
	}

	// Create/update the list in each category
	Layout();

	// Handle click events from all enabled controls
	// But only first time - not when changing epidode
	if(!rebooted)
	{
		myApp.ControlManager.Events.Click(ListSelector);
	}
}

// Handler to select from the list of controls
function ListSelector(pg, ctl) {

	var pos;
	var side;
	var size;
	var props = {};
	
	// If the episode has a discharge date or is a cancelled episode
	if(myApp.Activity.Properties.Episode(Vitro.EPISODE.Discharge) != "" ||
		myApp.Activity.Properties.Episode(Vitro.EPISODE.Type) == CANCELLED_EPISODE) 
	{
		// Prevent clicks
		return;
	}
	
	// Find the control index
	var index = parseInt(ctl.Properties.ID().split("[")[1]);

	// Reset the selection object
	if(appsSelectedCount === 0) appsSelected = {};

	// The relevant control we get fron the index (this is the panel)
	ctl = pg.pnlRow[index];

	if(typeof ctl === "undefined") return;

	// Turning off the check-box if selected already
	if(ctl.AppId in appsSelected)
	{
		ctl.Attribute(Vitro.CONTROL.BorderColour, GREEN);

		pg.imgCheck[index].Value("");

		delete appsSelected[ctl.AppId];
		appsSelectedCount--;
	}
	// Turn on if not in use or is multiactive
	else if(!mapAppId[ctl.AppId].Active || mapAppId[ctl.AppId].Multi)
	{
		pg.imgCheck[index].Value({
			FileType: ".png",
			Base64: tick
		});

		ctl.Attribute(Vitro.CONTROL.BorderColour, RED);
		appsSelected[ctl.AppId] = true;
		appsSelectedCount++;
	}

	// Enable or disable the create button if there are selections
	if(appsSelectedCount)
		myApp.Enable(CREATE);
	else
		myApp.Disable(CREATE);
}

// Handling the page displayed event
function PageDisplayed(pg) {
	var cat = pg.Title();
	
	// IF not already displayed - then do it
	if(!Categories[cat].Displayed)
	{
		Categories[cat].Displayed = true;
		LayoutCategory(cat);
	}
}

// The drawing function for the pages (categories)
function Layout()
{
	// For each/all categories
	for(var cat in Categories)
	{
		// If displayed or to be displayed - draw/redraw
		if(Categories[cat].Displayed)
			LayoutCategory(cat);
	}
}

// The drawing function for a single page (category)
function LayoutCategory(cat) {	
	var i;
	var catPage;
	var ctl;
	var index;
	var check;
	var text;

	var img;
	var catApps;

	// The page for the category
	catPage = Categories[cat].Page;

	// Only firstime
	if(!Categories[cat].Drawn)
	{
		// Create the page ros for a category
		ProcessPageRows(catPage);
	}

	// The Apps associated to the category
	catApps = Categories[cat].Apps;
	for(i = 0; i < catApps.length; i++)
	{
		// Get local vars to the row
		ctl = catPage.pnlRow[i];
		img = catPage.imgChartbook[i];
		check = catPage.imgCheck[i];
		text = catPage.txtName[i];

		// Set the App name
		text.Value(catApps[i].Name);

		// Store the App Id in a new property of the control and keep a reference in the Category Apps object
		ctl.AppId = catApps[i].Id;
		catApps[i].Ctl = ctl;

		// Only firsttime
		if(!Categories[cat].Drawn)
		{
			ctls.Add(ctl);
		}
		
		// There is an entry for this App in the used/active list for this episode/patient
		if(ctl.AppId in mapAppId) {
			// The App is aready active - but multi activities are not allowed - disable clicking
			if(mapAppId[ctl.AppId].Active && !mapAppId[ctl.AppId].Multi)
			{
				img.Disable().Value({
					FileType: ".png",
					Base64: chartBookIcon
				});
				// Clear the highlighting (in case it is set before a change episode)
				ctl.AttributeEx(Vitro.CONTROL.Border, false);
			}
			// The App is aready active - but multi activities are allowed
			else if(mapAppId[ctl.AppId].Active && mapAppId[ctl.AppId].Multi)
			{
				img.Enable().Value({
					FileType: ".png",
					Base64: greenChartbook
				});

				// The episode does not have a discarhge date and is not a cancelled episode - so show the green border
				if(myApp.Activity.Properties.Episode(Vitro.EPISODE.Discharge) == "" &&
					myApp.Activity.Properties.Episode(Vitro.EPISODE.Type) != CANCELLED_EPISODE) {
					ctl.AttributeEx(Vitro.CONTROL.Border, true);
					ctl.Attribute(Vitro.CONTROL.BorderColour, GREEN);
				}
				else {
					// Clear the highlighting (in case it is set before a change episode)
					ctl.AttributeEx(Vitro.CONTROL.Border, false);
				}
			}
			// App is used
			else
			{
				// Clear the image (in case it is set before a change episode)
				img.Value("");

				// The episode does not have a discarhge date and is not a cancelled episode - so show the green border
				if(myApp.Activity.Properties.Episode(Vitro.EPISODE.Discharge) == "" &&
					myApp.Activity.Properties.Episode(Vitro.EPISODE.Type) != CANCELLED_EPISODE) {
					ctl.AttributeEx(Vitro.CONTROL.Border, true);
					ctl.Attribute(Vitro.CONTROL.BorderColour, GREEN);
				}
				else {
					// Clear the highlighting (in case it is set before a change episode)
					ctl.AttributeEx(Vitro.CONTROL.Border, false);
				}
			}
		}
		
		// Already selected
		if(ctl.AppId in appsSelected)
		{
			check.Value({
				FileType: ".png",
				Base64: tick
			});

			ctl.Attribute(Vitro.CONTROL.BorderColour, RED);
		}
	}

	Categories[cat].Drawn = true;
}

// Creates the activity for an App (for a patient/episode)
function Creator(appId, lastflag, close)
{
	Vitro.Workflow.CreateActivity(appId, pID, eID, undefined, function(act) {
		// Set its status as submitted and update
		act.Status = Vitro.STATUS.Submitted;
		act.Update(undefined, function(act) {
			// Close or renable the buttons?
			if(close && lastflag)
			{
				myApp.Action(Vitro.ACTIONS.Close);
			}
			else if(lastflag)
			{
				pages.Each.Enable();
			 	myApp.Enable(SEARCH);
 				myApp.Enable(Vitro.ACTIONS.Close);
			}
		});
	});
}

// Default Actioned handler
function myApp_Actioned(action) {
	// Episode changed?
	if(action == Vitro.ACTIONS.Episode)
	{
		// An episode is set
		if(myApp.Activity.Properties.Episode(Vitro.EPISODE.ID))
		{
			eID = parseInt(myApp.Activity.Properties.Episode(Vitro.EPISODE.ID));
			BootStrap();
		}
		// Not selected/or reset - reset to the same one
		else
		{
			myApp.Episode(eID);
		}
	}
}

// Default Actions handler
function myApp_Actions(action) {
	var act;
 	var data = [];
	var i;

	if(action == Vitro.ACTIONS.Episode)
	{
		rebooted = true;
	}
	else if(action == CREATE)
	{
		if(appsSelectedCount == 1)
		{
			ProcessSelectedApps();
			return;
		}
		
	 	if(dsCreate == null)
		{
			dsCreate = myApp.DataSource("CreateDataSource");
		    dsCreate.Events.Ok(ProcessSelectedApps);
	 	}

		// For all apps
		for(i = 0; i < apps.length; i++)
		{
			// Selected already - or not selectable - ignore
			if(apps[i].Id in appsSelected)
			{
				data.push({
					"Id": apps[i].Id,
					"Name": apps[i].Name,
					"Category": apps[i].Category,
					"Description": apps[i].Description
				});
			}
		}

	 	SetupCreateDS(dsCreate, data);
	 }
	 else if(action == SEARCH)
	 {
	 	// One time setup
	 	if(dsSearch == null)
		{
			dsSearch = myApp.DataSource("SearchDataSource");
			
			// When the user selects from the search
		    dsSearch.Events.Ok(function() {
				var resultCount = dsSearch.Property(Vitro.DATASOURCE.Count);
				var index;
				var category;
				var i, j;
				var ctl, pg;
				
				// Look through each result if any
				for(j = 0; j < resultCount; j++)
				{
					index = +dsSearch.Value(j, "Id");
					category = dsSearch.Value(j, "Category");
					
					// Ensure the page is laid out for the category
					PageDisplayed(Categories[category].Page);
					
					// Find the Aoo
					for(i = 0; i < apps.length; i++)
					{
						if(apps[i].Id == index) {
							ctl = apps[i].Ctl;
							pg = pages.Item(ctl.Properties.PageID());
							
							// Fire the selector
							ListSelector(pg, ctl);
						}
					}
				}
		    });
	 	}

		// For all apps
		for(i = 0; i < apps.length; i++)
		{
			// Selected already - or not selectable - ignore
			if(apps[i].Id in appsSelected || (mapAppId[apps[i].Id].Active && !mapAppId[apps[i].Id].Multi))
				continue;

			data.push({
				"Id": apps[i].Id,
				"Name": apps[i].Name,
				"Category": apps[i].Category,
				"Description": apps[i].Description
			});
		}

	 	SetupSearchDS(dsSearch, data);
	 }
}

function ProcessSelectedApps() {
	// Disable buttons and pages while creating
 	myApp.Disable(CREATE);
 	myApp.Disable(SEARCH);
 	myApp.Disable(Vitro.ACTIONS.Close);
	pages.Each.Disable();

	// Tell chartbook that activities are updated....
	myApp.ActivitiesUpdated(true);
	
	// Close if the apps count is more than one
	var close = appsSelectedCount > 1;
 	for(var appId in appsSelected)
	{
		// Create the activities
		Creator(parseInt(appId), (--appsSelectedCount) === 0, close);

		// Mark created
		for(i = 0; i < apps.length; i++)
		{
			if(apps[i].Id == appId)
			{
				apps[i].Ctl.Attribute(Vitro.CONTROL.BorderColour, GREEN);
				apps[i].Ctl.Disable();
				break;
			}
		}
	}
}

function SetupSearchDS(ds, json) {
	// Set the table/view to reference and configure
	ds.Property(Vitro.DATASOURCE.Json, JSON.stringify(json));
	//ds.Property(Vitro.DATASOURCE.PreLoad, 'true');
    ds.Property(Vitro.DATASOURCE.Rows, json.length);
    ds.Property(Vitro.DATASOURCE.Title, 'Select App');
    ds.Property(Vitro.DATASOURCE.Display, 'Select App');
	ds.Property(Vitro.DATASOURCE.Count, 1);
	ds.Property(Vitro.DATASOURCE.Mode, "Min");	

    // Select the columns from the table and view to be available and set the display title and visibility of each
	ds.Column('Id', 'Id', false);
	ds.Column('Name', 'Name', true);
	ds.Column('Category', 'Category', true);
	ds.Column('Description', 'Description', false);

	// Initialise the data source - if PreLoad is true, the data is fetched
    ds.Initialise();
	ds.Launch();
}

function SetupCreateDS(ds, json) {
	// Set the table/view to reference and configure
	ds.Property(Vitro.DATASOURCE.Json, JSON.stringify(json));
    ds.Property(Vitro.DATASOURCE.Rows, json.length);
    ds.Property(Vitro.DATASOURCE.Title, 'Confirm');
    ds.Property(Vitro.DATASOURCE.Display, 'Confirm Selected Apps');
	ds.Property(Vitro.DATASOURCE.Count, 0);
	ds.Property(Vitro.DATASOURCE.Mode, "Min");	

    // Select the columns from the table and view to be available and set the display title and visibility of each
	ds.Column('Id', 'Id', false);
	ds.Column('Name', 'Name', true);
	ds.Column('Category', 'Category', true);
	ds.Column('Description', 'Description', false);

	// Initialise the data source - if PreLoad is true, the data is fetched
    ds.Initialise();
	ds.Launch();
}

// Makes rows (dynamic) for a page
function ProcessPageRows(pg)
{
	var i;
	var pnl = pg.Control("pnlRow");
	var ctls = pnl.Properties.Children();
	var pnlClone;
	var cat = pg.Title();

	// For all Apps in a category
	for(i = 0; i < Categories[cat].Count; i++)
	{
		// Clone the row (and its children) and offset the position on each row
		pnlClone = CloneControl(pnl, i);
		pnlClone.Show();
		pnlClone.AttributeEx(Vitro.CONTROL.Position, [ 20, CONTROL_HEIGHT * i + PADDING ] );
		ctls.Iterate(CloneControl, null, i, pnlClone);
	}

	ctls.Iterate(function(ctl) {
		pg.RegisterRepeater(ctl.Properties.ID(), Categories[cat].Count);
	});
	pg.RegisterRepeater("pnlRow", Categories[cat].Count);
}

// Clone a control (uses the TypeLookup to get the properties to copy)
function CloneControl(ctl, index, parent)
{
	var clone;
	var cType = TypeLookup[ctl.Properties.Type()];
	var pg = myApp.PageManager.Page(ctl.Properties.PageID());
    var props = {};
    var propertiesToIgnore = [
        Vitro.TEXTBOX.MaxWidth, Vitro.TEXTBOX.MaxHeight, Vitro.TEXTBOX.ActualWidth, Vitro.TEXTBOX.ActualHeight,
        Vitro.IMAGE.CropVisible, Vitro.IMAGE.RotAntiClockVisible, Vitro.IMAGE.RotClockVisible, Vitro.IMAGE.ScanVisible,
        Vitro.IMAGE.CameraVisible, Vitro.TEXTBOX.TextDecoration
    ];

	for(var a in cType)
	{
		// Filter some cantakerous properties that cause unneeded warning logs in the errortracking
		if(propertiesToIgnore.indexOf(cType[a]) !== -1) continue;
		props[cType[a]] = ctl.Attribute(cType[a]);
	}

	// indexed uniquely
	props[Vitro.CONTROL.Name] = ctl.Properties.ID() + "[" + index + "]";
	clone = pg.CreateControl(ctl.Properties.Type(), props, parent);

	// Clone visual properties too
	ctl.Properties.IsReadOnly() ? clone.ReadOnly() : clone.Writeable();
	ctl.Properties.IsVisible() ? clone.Show() : clone.Hide();
	ctl.Properties.IsEnabled() ? clone.Enable() : clone.Disable();

	return clone;
}
